import { useEffect, useState } from 'react';

const Splashscreen = () => {
  const [showSplash, setShowSplash] = useState(true);
  useEffect(() => setShowSplash(false), []);

  return (
    <div
      className={`bg-primary flex justify-center items-center left-0 top-0 absolute w-screen h-screen pointer-events-none transition-opacity duration-500 delay-1000 z-[9999] opacity-100 ${!showSplash && '!opacity-0'}`}
    >
      <img
        draggable="false"
        className="w-40"
        style={{
          filter: 'brightness(0) invert(1)'
        }}
        src="data:image/webp;base64,"
      />
    </div>
  );
};

export default Splashscreen;
